class Enemy extends Animation{constructor(a,b,c,d,e,f,g,h,i,j){super(a,b,c,d,e,f,g,h),this.originalX=c,this.originalSpeed=i,this.speed=i,this.delay=j,this.hasCollided=!1}setSpeed(a){this.speed=a}move(){this.x-=this.speed,this.x<-this.characterWidth-this.delay&&(this.x=width)}stop(){this.x<-this.characterWidth&&this.setSpeed(0)}restart(){this.x=this.originalX,this.setSpeed(this.originalSpeed),this.animate()}}